import React from "react";
import { createBottomTabNavigator } from "@react-navigation/bottom-tabs";
import { createNativeStackNavigator } from "@react-navigation/native-stack";
import Ionicons from "react-native-vector-icons/Ionicons";
import DietScreen from "../screens/DietScreen";
import HomeScreen from "../screens/HomeScreen";
import ProfileScreen from "../screens/ProfileScreen";
import DoctorProfileScreen from "../screens/DoctorProfileScreen";
import {
  getAuth,
  createUserWithEmailAndPassword,
  firestore,
} from "firebase/auth";
import {
  getFirestore,
  doc,
  getDoc,
  addDoc,
  collection,
  query,
  where,
  getDocs,
} from "firebase/firestore";
import app from "../../firebase";

const auth = getAuth(app); // Initialize Firebase Authentication
const db = getFirestore();
const Tab = createBottomTabNavigator();
const Stack = createNativeStackNavigator();
const user = auth.currentUser;

const HomeStackNavigator = () => {
  return (
    <Stack.Navigator>
      <Stack.Screen
        name="HomeStack"
        component={HomeScreen}
        options={{ headerShown: false }}
      />

    </Stack.Navigator>
  );
};
const decideprofile = () => {
  const user = auth.currentUser;
  const patientsCollection = collection(db, "patients");
  const theraCollection = collection(db, "therapist");
  let decider = 0;
  const q = query(patientsCollection, where("email", "==", user.email));
  const querySnapshot = getDocs(q);
  if (!querySnapshot.empty){
    decider++;
    console.log(decider);
  }
  return decider;
}

const HomeTabNavigator = () => {
  if(decideprofile == 1){
    console.log('we did it boys');
  }else{
    console.log('crippling depression');
  }
  return (
    <Tab.Navigator
      screenOptions={({ route }) => ({
        tabBarIcon: ({ focused, color, size }) => {
          let iconName;

          if (route.name === "Home") {
            iconName = "md-home-outline";

          } else if (route.name === "Diet") {
            iconName = "md-restaurant-outline";
          } else if (route.name === "Profile") {
            iconName = "md-person-outline";
          }

          return <Ionicons name={iconName} size={size} color={color} />;
        },
        tabBarActiveTintColor: "#216afc",
        tabBarInactiveTintColor: "gray",
        headerShown: false,
      })}
    >
      <Tab.Screen
        name="Home"
        component={HomeStackNavigator}
        options={{ headerShown: false }}
      />

      <Tab.Screen name="Healthy Life" component={DietScreen} />
      <Tab.Screen
        name="Profile"
        component={ProfileScreen}
        options={{
          headerShown: true,
          headerTitle: "Personal Infomation",
          headerTitleAlign: "center",
        }}
      />

      <Tab.Screen
        name="DoctorProfile"
        component={DoctorProfileScreen}
        options={{
          headerShown: true,
          headerTitle: "Personal Infomation",
          headerTitleAlign: "center",
        }}
      />
    </Tab.Navigator>
  );
};

export default HomeTabNavigator;
